import Fonth2 from "../../styles/fontsStyles/Fonth2"

import home from "../../content/home.json"
import team from "../../content/team.json"


home.map((member, i) => {
    const { img, title, text1, text2 } = member;
    return (
        <div className="global" key={i} >
            <div className="colum1" >
                <img src={img} />
            </div>
            <div className="title">
                <Fonth2> {title}</Fonth2>
            </div>
            <div className="colum1">
                <div className="text">
                    <Fonth1> {text1}</Fonth1>
                    <FontP> {text2}</FontP>
                </div>
            </div>
        </div>
    )
})


const Team = props => {
    return (
        <TeamStyle >
           {displayHome()}
        </TeamStyle>
    );
};

export default Team;
